<script>
  function createPokemon(){
    var app = document.getElementById('app');
    for(var i=1; i<=649; i++){
      var p = new Pokemon(i);

      var div = document.createElement('div');
      div.className = 'pokemon pokemon-'+i;
      var info = document.createElement('div');
      info.className = 'pokemon-info';
      info.innerHTML = '[ '+p.getId()+' ] '+p.getName('zh')+' '+p.getName();
      div.appendChild(p.go());
      div.appendChild(info);
      app.appendChild(div);
    }
  }
  createPokemon();
</script>
